import React, { useEffect, useState } from "react";
import {
  View,
  ScrollView,
  Text,
  Animated,
  TextInput,
  Pressable,
  TouchableOpacity,
  Image,
} from "react-native";
import { SvgXml } from "react-native-svg";
import { useSelector, useDispatch } from "react-redux";
import { Color } from "../../assets/colors";
import { getOnlineUser, getOfflineMembers } from "../../Class/member";
import ActivityLoader from "../../components/ActivityLoader";
import { AntDesign, FontAwesome } from "@expo/vector-icons";
import BackHeader from "../../components/BackHeader";
import SubHeader from "../../components/SubHeader";
import { useSafeAreaInsets } from "react-native-safe-area-context";
import { StatusBar } from "expo-status-bar";

export default function MemberList({ navigation, route }) {
  const [Data, setData] = React.useState();
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const textColor = colors.getTextColor();
  const primaryColor = colors.getPrimaryColor();
  const assentColor = colors.getAssentColor();
  const backgroundColor = colors.getBackgroundColor();
  const secondaryColor = colors.getSecondaryColor();
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const [Loading, setLoading] = React.useState(true);
  const scrollY = new Animated.Value(0);
  const diffClamp = Animated.diffClamp(scrollY, 0, 300);
  const translateY = diffClamp.interpolate({
    inputRange: [0, 300],
    outputRange: [0, -300],
  });
  const [Search, setSearch] = React.useState();
  const offline = route.params.offline;
  const inset = useSafeAreaInsets();
  const [users, setUsers] = useState();
  

  React.useEffect(() => {
    if (user && vendor) {
      if (offline) {
        getOfflineMembers(user.token, vendor.service.id)
          .then((res) => {
            setLoading(false);
            setData(res.members);
            setUsers(res.members);
          })
          .catch((err) => {
            setLoading(false);
            console.warn(err.response.data.message);
          });
        return;
      }
      getOnlineUser(user.token, vendor.service.id)
        .then((res) => {
          setLoading(false);
          setData(res.members);
          setUsers(res.members);
        })
        .catch((err) => {
          setLoading(false);
          console.warn(err.response.data.msg);
        });
    }
  }, [user + vendor]);
  useEffect(() => {
    if (!Search) {
      setUsers(Data);
    } else {
      setUsers(
        Data?.filter((d) =>
          d.user.name.toUpperCase().match(Search.toUpperCase())
        )
      );
    }
  }, [Search]);
  if (!Data) {
    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <ActivityLoader />
      </View>
    );
  }

  return (
    <View
      style={{
        flex: 1,
      }}>
      <StatusBar style="dark" backgroundColor="#ffffff" />
      <View
        style={{
          height: inset?.top,
        }}
      />
      <ScrollView
        style={{ flex: 1, backgroundColor: "#FFFFFF" }}
        stickyHeaderIndices={[0]}
        scrollEventThrottle={16}
        stickyHeaderHiddenOnScroll={true}
        showsVerticalScrollIndicator={false}
        onScroll={(e) => {
          scrollY.setValue(e.nativeEvent.contentOffset.y);
          //scroll;
        }}>
        <Animated.View
          style={[
            {
              transform: [{ translateY: translateY }],
              top: 0,
              left: 0,
              right: 0,
              backgroundColor: secondaryColor,
              zIndex: 500,
            },
          ]}>
          <View
            style={{
              flexDirection: "row",
              justifyContent: vendor ? "space-between" : "flex-end",
              paddingVertical: 16,
              alignItems: "center",
              backgroundColor: "#ffffff",
              paddingHorizontal: 20,
              borderBottomWidth: 1,
              borderBottomColor: "#F1EFEF",
            }}>
            <View
              style={{
                flexDirection: "row",
                borderRadius: 4,
                backgroundColor: "#ffffff",
                flex: 1,
                height: 32,
                paddingHorizontal: 16,
                alignItems: "center",
                borderWidth: 1,
                borderColor: "#D1D1D1",
              }}>
              <TextInput
                onChangeText={setSearch}
                value={Search}
                style={{ flex: 1 }}
                placeholder="Type name"
              />
              <SvgXml xml={searchIcon} />
            </View>
            <Pressable
              onPress={() => {
                navigation.goBack();
              }}
              style={{
                marginLeft: 8,
              }}>
              <Text
                style={{
                  fontWeight: "400",
                  fontSize: 16,
                }}>
                Cancel
              </Text>
            </Pressable>
          </View>
        </Animated.View>
        {/* <Text
          style={{
            marginHorizontal: 20,
            marginVertical: 10,
            fontSize: 16,
            color: textColor,
            fontFamily: "Poppins-SemiBold",
          }}>
          {Data.length > 9 ? Data.length : "0" + Data.length} Members
        </Text> */}
        <View style={{ height: 8 }} />
        {users &&
          users.map((doc, i) => (
            <UserCart
              onSelect={() => {
                navigation.navigate("VendorServiceList", {
                  userId: doc.userId ? doc.userId : doc.id,
                  offline: offline,
                });
              }}
              data={doc}
              key={i}
            />
          ))}
        {Data && Data.length == 0 && (
          <View
            style={{
              alignItems: "center",
              height: "100%",
              paddingTop: "20%",
              justifyContent: "center",
            }}>
            <SvgXml xml={vectorImage} />
            <Text
              style={{
                color: textColor,
                fontSize: 16,
                marginTop: 20,
              }}>
              No member found!
            </Text>
          </View>
        )}
        {users && users.length == 0 && (
          <View
            style={{
              alignItems: "center",
              height: "100%",
              paddingTop: "20%",
              justifyContent: "center",
            }}>
            <SvgXml xml={noIcon} />
            <Text
              style={{
                color: textColor,
                fontSize: 16,
                marginTop: 20,
              }}>
              No member found!
            </Text>
          </View>
        )}
        <View style={{ height: 8 }} />
      </ScrollView>
    </View>
  );
}
