const UserCart = ({ data, onSelect }) => {
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const textColor = colors.getTextColor();
  const primaryColor = colors.getPrimaryColor();
  const assentColor = colors.getAssentColor();

  return (
    <TouchableOpacity
      onPress={() => {
        if (onSelect) {
          onSelect(data.id);
        }
      }}>
      <View
        style={{
          backgroundColor: primaryColor,
          paddingHorizontal: 20,
          paddingVertical: 4,
          paddingTop: 0,
          marginVertical: 8,
        }}>
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            alignItems: "center",
            paddingTop: 0,
          }}>
          <View style={{ flexDirection: "row", alignItems: "center", flex: 1 }}>
            <View
              style={{
                borderWidth: 1,
                width: 40,
                height: 40,
                borderRadius: 25,
                justifyContent: "center",
                alignItems: "center",
                overflow: "hidden",
                borderColor: "#e5e5e5",
              }}>
              {data && data.user && data.user.profilePhoto ? (
                <Image
                  style={{
                    height: 40,
                    width: 40,
                  }}
                  source={{ uri: data.user.profilePhoto }}
                />
              ) : data && data.profilePhoto ? (
                <Image
                  style={{
                    height: 40,
                    width: 40,
                  }}
                  source={{ uri: data.profilePhoto }}
                />
              ) : (
                <FontAwesome name="user" size={30} color={assentColor} />
              )}
            </View>
            <View
              style={{
                marginLeft: 10,
                flex: 1,
                marginRight: 20,
              }}>
              {data && data.user ? (
                <Text
                  numberOfLines={1}
                  style={{
                    color: textColor,
                    fontSize: 16,
                    fontFamily: "Poppins-Medium",
                  }}>
                  {data ? data.user.name : "Um"}{" "}
                  
                </Text>
              ) : (
                <Text
                  numberOfLines={1}
                  style={{
                    color: textColor,
                    fontSize: 16,
                    fontFamily: "Poppins-Medium",
                  }}>
                  {data.name}
                </Text>
              )}
              {/* <Text
                numberOfLines={1}
                style={{
                  fontSize: 14,
                  color: textColor,
                  fontFamily: "Poppins-Medium",
                }}>
                {data.user ? "@" : ""}
                {data && data.user
                  ? data.user.username
                  : data && data.gender
                  ? data.gender
                  : "Empty position"}
              </Text> */}
            </View>
          </View>
        </View>
      </View>
    </TouchableOpacity>
  );
};
